import React, { Component } from 'react'
import Todoitem from './Todoitem';

export class Todos extends Component {
  render() {
    return (
      this.props.todos.map((todo) => (
      <h3>{todo.id} { todo.title }</h3>
      ))
    );
  }
}

export default Todos
